INSERT INTO `tblplaces` VALUES (11,1,NULL,'70 SEK','Amusement Park','Liseberg','http://liseberg.se','Liseberg is an amusement park located in Gothenburg, Sweden, the park opened in 1923. Liseberg is one of the most visited amusement parks in Scandinavia, attracting around 3 million visitors annually. Among the noteworthy attractions is the wooden roller coaster Balder, voted twice (2003 and 2005) as the Best Wooden Tracked Roller Coaster in the world in a major international poll. The park itself has also been chosen as one of the top ten amusement parks in the world (2005) by Forbes Magazine.'),(12,1,NULL,'160 SEK','Tropical Park','Universeum','http://www.universeum.se','Universeum is a public science centre in Gothenburg, Sweden that opened in 2001. It is a part of Evenemangsstrket, the thoroughfare of events  close to Korsvgen and Sknegatan  which includes sights of interest like Scandinavium, Ullevi, Svenska Mssan (Swedish Exhibition Centre), Liseberg and the Museum of World Culture. The Universeum is divided into six sections, each containing experiment workshops and a collection of reptiles, fish and insects. The Universeum occasionally gives Swedish secondary school students a chance to debate with Nobel prize-winners and professors.'),(13,1,NULL,'95 SEK','Entertainment','Gteborgshjulet','http://www.goteborg.com/goteborgshjulet','Since it\'s opening on May 22 2010, the Wheel of Gothenburg has had more than 200 000 visitors. Experience it\'s time on Kanaltorget on our Youtube channel. As of January 2, 2012 The Wheel of Gothenburg no longer will be located on Kanaltorget, next to the Opera House and lvrummet. Instead, it will move to the Liseberg amusement park. The dismantling of the wheel is expected to take five weeks, and Kanaltorget will then be restored to it\'s original condition.The next time the wheel will be open is in conjunction with the Liseberg season premiere.'),(14,1,NULL,'40 SEK','Museum','Gteborgs Konstmuseum','http://konstmuseum.goteborg.se','The Gteborg Museum of Art at Gtaplatsen, Gothenburg, is renowned for its collection of Nordic art from around the close of the 19th century. A must see is the lavishly decorated Frstenberg Gallery, named after a leading Gothenburg art donor, Pontus Frstenberg and his wife Gthilda. Among the artists showcased one can mention Carl Larsson, Anders Zorn, and P.S. Kryer. The museum also houses older and contemporary art, both Nordic and international. The Museum has been awarded three stars in the Michelin Guide (Green Guide Scandinavia).'),(15,1,NULL,'300 SEK','Opera','Gtebogsoperan','http://en.opera.se/','The Gothenburg Opera house is relatively new: construction started in September 1989 after significant local commitment in the late 1980s (with as many as 6,000 contributors to the new house) and it was completed with great speed. Ground breaking took place in June 1991, and the building was inaugurated in October 1994.It hosted Melodifestivalen 2000, the Swedish selection to the Eurovision Song Contest. The result was a world class opera house with its auditorium built in the classical style. With its stalls and balconies, it has 1,301 seats. The orchestra pit has room for about 100 musicians. The House is shared by opera, ballet, musicals and operettas so the architects had to meet a number of challenges.'),(21,2,NULL,'100 SEK','Museum','Van Gogh Museum','http://www.vangoghmuseum.nl/vgm/index.jsp?lan','The Van Gogh Museum is an art museum in Amsterdam, Netherlands, featuring the works of the Dutch painter Vincent van Gogh and his contemporaries. It has the largest collection of Van Gogh\'s paintings and drawings in the world. Design for a Van Gogh Museum was commissioned by the Dutch government in 1963 to Dutch architect and furniture designer Gerrit Rietveld. Rietveld died a year later, and the building was not completed until 1973. An Exhibition Wing was added in 1999 by Japanese modernist Kisho Kurokawa.'),(22,2,NULL,'100 SEK','Museum','Rijksmuseum','http://www.rijksmuseum.nl/','The Rijksmuseum is a Dutch national museum in Amsterdam, located on the Museumplein. The museum is dedicated to arts, crafts, and history. It has a large collection of paintings from the Dutch Golden Age and a substantial collection of Asian art. It also displays the stern of the HMS Royal Charles which was captured in the Raid on the Medway, and the Hartog plate. The museum was founded in 1800 in The Hague to exhibit the collections of the Dutch stadtholders. It was inspired by French example. By then it was known as the National Art Gallery. In 1808 the museum moved to Amsterdam on the orders of king Louis Bonaparte, brother of Napoleon Bonaparte. The paintings owned by that city, such as The Night Watch by Rembrandt, became part of the collection.'),(23,2,NULL,'150 SEK','Entertainment','Heineken Experience','http://www.heinekenexperience.com','The Heineken Experience, located in Amsterdam, is an historic brewery and corporate visitor center for the internationally distributed Dutch pilsner, Heineken beer. The industrial facility was built as the first Heineken brewery in 1867, serving as the company\'s primary brewing facility until 1988 when a more modern, larger facility was constructed on the outskirts of the city. In 1991, the brewery opened to the public as a brewery tour and visitor center, known as the Heineken Treat and Information Centre. The attraction grew to become one of Amsterdam\'s most popular tourist attractions and by 2001 the visitor center changed its name to Heineken Experience.'),(24,2,NULL,'500 SEK','Entertainment','Red Light District','http://amsterdam-red-light-district.info/','The Amsterdam Red Light District covers a large area of the oldest part of the city. The buildings are tall, thin and crowd together, overlooking the tree lined canals. The Red Light District Amsterdam is a beautiful area and the later it gets, the busier it gets. And the darker it gets, the more obvious the glow of the fluorescent red lights above the many windows in the area becomes. Dating back to the 14th Century when sailors arrived in need of some female company, the redlight area is full of sex shops, brothels, gay bars, cinemas, hotels and different kinds of museums. This infamous part of the city is a major tourist attraction. Each year, millions of visitors come to see this vibrant and exciting part of Amsterdam.'),(25,2,NULL,'300 SEK','Entertainment','Concertgebouw','http://www.concertgebouw.nl/','The Concertgebouw is a concert hall in Amsterdam, Netherlands. The Dutch term literally translates into English as \"concert building\". Because of its highly regarded acoustics, the Concertgebouw is considered one of the finest concert halls in the world, along with places such as Boston\'s Symphony Hall and the Musikverein in Vienna. The architect of the building was Adolf Leonard van Gendt, who was inspired by the Neue Gewandhaus in Leipzig, built two years earlier (and destroyed in 1943). Construction began in 1883 in a pasture that was then outside the city, in Nieuwer-Amstel, a municipality that in 1964 became Amstelveen. 2,186 piles twelve to thirteen meters (forty to forty-three feet) in length were sunk into the soil.'),(31,3,NULL,'150 SEK','Museum','Louvre','http://www.louvre.fr/llv/commun/home.jsp?bmLo','The Muse du Louvre in English, the Louvre Museum or simply the Louvre  is one of the world\'s largest museums, the most visited art museum in the world and a historic monument. A central landmark of Paris, it is located on the Right Bank of the Seine in the 1st arrondissement (district). Nearly 35,000 objects from prehistory to the 19th century are exhibited over an area of 60,600 square metres (652,300 square feet). The museum is housed in the Louvre Palace (Palais du Louvre) which began as a fortress built in the late 12th century under Philip II. Remnants of the fortress are visible in the basement of the museum. The building was extended many times to form the present Louvre Palace.'),(32,3,NULL,'100 SEK','Church','Notre Dame','http://www.notredamedeparis.fr/spip.php?rubri','Notre Dame de Paris, also known as Notre Dame Cathedral, is a Gothic, Roman Catholic cathedral on the eastern half of the le de la Cit in the fourth arrondissement of Paris, France. It is the cathedral of the Catholic Archdiocese of Paris: that is, it is the church that contains the cathedra (official chair) of the Archbishop of Paris, currently Andr Vingt-Trois. The cathedral treasury houses a reliquary with the purported Crown of Thorns. Notre Dame de Paris is widely considered one of the finest examples of French Gothic architecture in France and in Europe, and the naturalism of its sculptures and stained glass are in contrast with earlier Romanesque architecture.'),(33,3,NULL,'100 SEK','Entertainment','Eiffel Tower','http://www.tour-eiffel.fr/','The Eiffel Tower is a wrought iron lattice tower located on the Champ de Mars in Paris. Built in 1889, it has become both a global icon of France and one of the most recognizable structures in the world. The tower is the tallest building in Paris[10] and the most-visited paid monument in the world; millions of people ascend it every year. Named after its designer, engineer Gustave Eiffel, the tower was built as the entrance arch to the 1889 World\'s Fair.The tower stands 324 metres (1,063 ft) tall, about the same height as an 81-storey building. During its construction, the Eiffel Tower surpassed the Washington Monument to assume the title of the tallest man-made structure in the world, a title it held for 41 years, until the Chrysler Building in New York City was built in 1930. '),(34,3,NULL,'250 SEK','Entertainment','Moulin Rouge','http://www.moulinrouge.fr/','Moulin Rouge is a cabaret built in 1889 by Joseph Oller, who also owned the Paris Olympia. Close to Montmartre in the Paris district of Pigalle on Boulevard de Clichy in the 18th arrondissement, it is marked by the red windmill on its roof. The closest mtro station is Blanche. The Moulin Rouge is best known as the spiritual birthplace of the modern form of the can-can dance. Originally introduced as a seductive dance by the courtesans who operated from the site, the can-can dance revue evolved into a form of entertainment of its own and led to the introduction of cabarets across Europe. Today the Moulin Rouge is a tourist destination, offering musical dance entertainment for visitors from around the world. Much of the romance of turn-of-the-century France is still present in the club\'s decor.'),(35,3,NULL,'100 SEK','Museum','Arc de Triomphe','http://www.arcdetriompheparis.com/','The Arc de Triomphe is one of the most famous monuments in Paris. It stands in the centre of the Place Charles de Gaulle (originally named Place de l\'toile), at the western end of the Champs-lyses. There is a smaller arch, the Arc de Triomphe du Carrousel, which stands west of the Louvre. The Arc de Triomphe honours those who fought and died for France in the French Revolutionary and the Napoleonic Wars, with the names of all French victories and generals inscribed on its inner and outer surfaces. Beneath its vault lies the Tomb of the Unknown Soldier from World War I.'),(41,4,NULL,'400 SEK','Entertainment','Real Madrid','http://www.entradasmadrid.com/','Real Madrid Club de Ftbol, commonly known as Real Madrid, is a professional football club based in Madrid, Spain. It was founded in 1902 as Madrid Football Club and has traditionally worn a white home kit since. The word Real is Spanish for royal and was bestowed to the club by King Alfonso XIII in 1920 together with the royal crown in the emblem. The club established itself as a major force in both Spanish and European football during the 1950s.'),(42,4,NULL,'100 SEK','Museum','Museo del Prado','http://www.museodelprado.es/en','The Museo del Prado is the main Spanish national art museum, located in central Madrid. It features one of the world\'s finest collections of European art, from the 12th century to the early 19th century, based on the former Spanish Royal Collection, and unquestionably the best single collection of Spanish art. Founded as a museum of paintings and sculpture, it also contains important collections of other types of works. A new, recently opened wing enlarged the display area by about 400 paintings, and it is currently used mainly for temporary expositions. El Prado is one of the most visited sites in the world, and it is considered to be among the greatest museums of art.'),(43,4,NULL,'50 SEK','Entertainment','Plaza de Oriente','http://en.wikipedia.org/wiki/Plaza_de_Oriente','The Palacio Real de Madrid is the official residence of the King of Spain in the city of Madrid, but it is only used for state ceremonies. King Juan Carlos and the Royal Family do not reside in the palace, choosing instead the more modest Palacio de la Zarzuela on the outskirts of Madrid. The palace is owned by the Spanish State and administered by the Patrimonio Nacional, a public agency of the Ministry of the Presidency. The palace is located on Calle de Bailn (Bailn Street), in the Western part of downtown Madrid, East of the Manzanares River, and is accessible from the pera metro station. The palace is partially open to public, except when it is being used for official business.\r\r'),(44,4,NULL,'130 SEK','Entertainment','Gran Via','http://en.wikipedia.org/wiki/Gran_V%C3%ADa_(M','Gran Va also Great Way is an ornate and upscale shopping street located in central Madrid. It leads from Calle de Alcal, close to Plaza de Cibeles, to Plaza de Espaa. The lively street is one of the city\'s most important shopping areas, with a large number of hotels and large movie theaters; it is also noted for the grand architecture prevalent among many of its buildings. Now, most of the theaters are being replaced by shopping malls. It is considered a showcase of early 20th century architecture, with patterns ranging from Vienna Secession style, Plateresque, Neo-Mudjar, Art Deco and others.'),(45,4,NULL,'50 SEK','Attraction','Edificio Espaa','http://en.wikipedia.org/wiki/Edificio_Espaa','The Edificio Espaa is one of the tallest buildings in Madrid, Spain. With its 25 storeys and 117 meters of height, it is the eighth-highest building of the Spanish capital, including the skyscrapers of the Cuatro Torres Business Area. It is also one of the better examples of twentieth century architecture in Spain. It was designed by the architect Julin Otamendi and his brother, the engineer Joaqun Otamendi. It was the tallest building in Spain until overtaken by the Torre de Madrid in 1957. The building formerly contained a Crowne Plaza hotel, a shopping centre, apartments, offices, and a swimming pool in its roof top. '),(51,5,NULL,'100 SEK','Attraction','Colosseum','http://en.wikipedia.org/wiki/Colosseum','The Colosseum, or the Coliseum, originally the Flavian Amphitheatre is an elliptical amphitheatre in the centre of the city of Rome, Italy, the largest ever built in the Roman Empire. It is considered one of the greatest works of Roman architecture and Roman engineering. Capable of seating 50,000 spectators, the Colosseum was used for gladiatorial contests and public spectacles such as mock sea battles, animal hunts, executions, re-enactments of famous battles, and dramas based on Classical mythology. The building ceased to be used for entertainment in the early medieval era. It was later reused for such purposes as housing, workshops, quarters for a religious order, a fortress, a quarry, and a Christian shrine.'),(52,5,NULL,'100 SEK','Museum','Pantheon','http://en.wikipedia.org/wiki/Pantheon,_Rome','The Pantheon is a building in Rome, Italy, commissioned by Marcus Agrippa as a temple to all the gods of Ancient Rome, and rebuilt by Emperor Hadrian in about 126 AD. The ancient Roman writer Cassius Dio speculated that the name comes either from the statues of so many gods placed around this building or from the resemblance of the dome to the heavens. Since the French Revolution, when the church of Sainte-Genevive in Paris, France was deconsecrated and turned into the secular monument called the Panthon of Paris, the generic term pantheon has sometimes been applied to other buildings in which illustrious dead are honored or buried.'),(53,5,NULL,'50 SEK','Museum','Basilica of Saint Paul','http://en.wikipedia.org/wiki/St._Peter\'s_Basi','The Papal Basilica of Saint Peter, officially known in Italian as Basilica Papale di San Pietro in Vaticano and commonly known as Saint Peter\'s Basilica, is a Late Renaissance church located within the Vatican City. Saint Peter\'s Basilica has the largest interior of any Christian church in the world. While it is neither the official mother church of the Roman Catholic Church nor the cathedral of the Pope as Bishop of Rome, Saint Peter\'s is regarded as one of the holiest Catholic sites. It has been described as holding a unique position in the Christian world and as the greatest of all churches of Christendom.\r\r'),(54,5,NULL,'120 SEK','Attraction','Piazza della Repubblica','http://en.wikipedia.org/wiki/Piazza_della_Rep','Piazza della Repubblica is a semi-circular piazza in Rome, at the summit of the Viminal Hill, next to the Termini station. On it is to be found Santa Maria degli Angeli e dei Martiri. The porticos around the piazza, built in 1887-98 by Gaetano Koch, were in memory of the ancient buildings on the same sites, while the basilica of Santa Maria degli Angeli e dei Martiri on the piazza is based on a wing of the baths (with its architect Michelangelo, using the tepidarium as one of the wings of its spacious Greek cross plan).'),(55,5,NULL,'100 SEK','Museum','National Museum of Rome','http://en.wikipedia.org/wiki/National_Museum_','The National Museum of Rome is a set of museums in Rome, Italy, split among various branches across the city. It was founded in 1889 and inaugurated in 1890, with the aim of collecting antiquities from between the 5th century BC to the 3rd century AD. Its first collection was formed from the archeological collections of the Museo Kircheriano, a collection assembled by the antiquarian Athanasius Kircher, soon supplemented by the numerous new discoveries in Rome that took place during the expansive city planning effort after it became the capital of the new Kingdom of Italy. This was initially meant to be displayed in a Museo Tiberino but in 1901 the State granted the institution the Villa Ludovisi and the important national collection of ancient sculptures.');
